import { makeStyles } from "@mui/styles";



export const useStyles = makeStyles({

  container:{
    width:1200,
    margin:'0 auto',
  },
  items:{
    display:'flex',
    flexDirection:'colums',
    width:'100%',
    justifyContent:'space-between'
  }

})
